import React from 'react';
import TeamSelect from './TeamSelect.js';

const Collaborator = ({ collaborator, teams }) => {

  // const availableTeams = teams.filter(team => !collaborator.teams.includes(team))
  const availableTeams = teams.filter(({ value: id1 }) => !collaborator.teams.some(({ value: id2 }) => id2 === id1));
  console.log(teams)
  // console.log(collaborator.teams)

  return (
    collaborator
      ? <div className="Collaborator">
          <h3>{collaborator.name}</h3>
          <p>Primary Role: {collaborator.role}</p>
          <p>Skills: {collaborator.skills}</p>
          <ul>{collaborator.teams.map ( team =>
            <li key={team.id}>
              {team.name}
            </li>
          )}</ul>
          {console.log(collaborator.teams)}
          <TeamSelect collaborator={collaborator} availableTeams={teams.filter(({ value: id1 }) => !collaborator.teams.some(({ value: id2 }) => id2 === id1))}/>
        </div>
      : <h3>...No Collaborator Here...</h3>
  )
}

export default Collaborator
